import './App.css';

import testLogo from './absolutemedialogo.png';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";

import HomePage from './HomePage';
import ProductPage from './product';

function App() {
  return (
    <>
    <Router>
            <Switch>
              <Route exact path = "/" component = {ProductPage} />
              <Redirect to = "/" />
            </Switch>
          </Router>
    
    </>
  )
}
export default App;
